"use strict";
var app = getApp();
Page({
    data: {
        a: 1,
        timer: 0,
        motto: 'Hello World',
        userInfo: {},
        hasUserInfo: false,
        canIUse: wx.canIUse('button.open-type.getUserInfo'),
        canIUseGetUserProfile: false,
        canIUseOpenData: wx.canIUse('open-data.type.userAvatarUrl') && wx.canIUse('open-data.type.userNickName'),
    },
    bindViewTap: function () {
        wx.navigateTo({
            url: '../logs/logs',
        });
    },
    imgError: function (data) {
        console.log('imgError---', typeof data);
    },
    onLoad: function () {
        var _this = this;
        if (wx.getUserProfile) {
            this.setData({
                canIUseGetUserProfile: true,
            });
        }
        this.data.timer = setInterval(function () {
            _this.data.a++;
            console.log(_this.data.a);
            if (_this.data.a === 4) {
                clearInterval(_this.data.timer);
            }
        }, 1000 * 5);
    },
    getUserProfile: function () {
        var _this = this;
        wx.getUserProfile({
            desc: '展示用户信息',
            success: function (res) {
                console.log(res);
                _this.setData({
                    userInfo: res.userInfo,
                    hasUserInfo: true,
                });
            },
        });
    },
    getUserInfo: function (e) {
        console.log(e);
        this.setData({
            userInfo: e.detail.userInfo,
            hasUserInfo: true,
        });
    },
    onShow: function () {
        console.log('route index', this.route);
    },
    onHide: function () {
        console.log('onHide index');
    },
});
